function generateRandomInteger(min, max) {
	// Generate a number between 0 and max, including max
	return Math.floor(Math.random() * max) + min;
}


function createPath(thisFrame) {
	
	// Build the path
	
	var thisPathPointInfo = thisFrame.split(";");
	var thisPathPointInfoProperties = [];
	
	var p = [];
	var pth = [];
	
	for (var i = 0; i < thisPathPointInfo.length; i++ ) {
		
		thisPathPointInfoProperties = thisPathPointInfo[i].split(" "); // Splitta thisPathPointInfo i dess properties
		
		p[i] = new PathPointInfo();
		p[i].kind = thisPathPointInfoProperties[0];
	
		var anchorString = thisPathPointInfoProperties[1].split(",");
		p[i].anchor = [anchorString[0]*1, anchorString[1]*1];
		
		var leftDirectionString = thisPathPointInfoProperties[2].split(",");
		p[i].leftDirection = [leftDirectionString[0]*1, leftDirectionString[1]*1];
		
		var rightDirectionString = thisPathPointInfoProperties[3].split(",");
		p[i].rightDirection = [rightDirectionString[0]*1, rightDirectionString[1]*1];

		p[i].typename = thisPathPointInfoProperties[4];
	
	}

	pth[0] = new SubPathInfo();
	pth[0].operation = ShapeOperation.SHAPEXOR;
	pth[0].closed = true;
	pth[0].entireSubPath = p;
	app.activeDocument.pathItems.add("Frame", pth);
	
}


function biggerCanvas(border_thickness) {
	
	// Enlarge the canvas
	
	if ( ratio > 1 ) {
			
			var new_doc_height = doc_height * border_thickness / ratio / 100 + doc_height;
			var new_doc_width = doc_width * border_thickness / 100 + doc_width;
	
			var offset = offset_factor * border_thickness / 100 * doc_width / generateRandomInteger(1, 10);
			
			var offset_2 = offset_factor * border_thickness / 100 * doc_width / generateRandomInteger(1, 10);
			
			// Offset
			app.activeDocument.resizeCanvas(UnitValue(offset + doc_width,"px"), UnitValue(offset_2 + doc_height,"px"), AnchorPosition.TOPRIGHT);
			
			// Enlarging canvas
			app.activeDocument.resizeCanvas(UnitValue(new_doc_width,"px"), UnitValue(new_doc_height,"px"), AnchorPosition.MIDDLECENTER);
			
		} else {
			
			var new_doc_height = doc_height * border_thickness / 100 + doc_height;
			var new_doc_width = doc_width * border_thickness * ratio / 100 + doc_width;
			
			var offset = offset_factor * border_thickness / 100 * doc_height / generateRandomInteger(1, 10);
			
			var offset_2 = offset_factor * border_thickness / 100 * doc_height / generateRandomInteger(1, 10);
			
			// Offset
			app.activeDocument.resizeCanvas(UnitValue(offset_2 + doc_width,"px"), UnitValue(offset + doc_height,"px"), AnchorPosition.TOPRIGHT);
			
			// Enlarging canvas
			app.activeDocument.resizeCanvas(UnitValue(new_doc_width,"px"), UnitValue(new_doc_height,"px"), AnchorPosition.MIDDLECENTER);
		}

}

function offset645() {
	
	var offset = 1.4 / generateRandomInteger(1, 10);
	
	if ( ratio > 1 ) {
		
		// Offset
		app.activeDocument.resizeCanvas(UnitValue(100 - offset,"%"), UnitValue(doc_height,"px"), AnchorPosition.MIDDLELEFT);
		// Restore canvas size
		app.activeDocument.resizeCanvas(UnitValue(doc_width,"px"), UnitValue(doc_height,"px"), AnchorPosition.MIDDLERIGHT);
		
	} else {
		
		// Offset
		app.activeDocument.resizeCanvas(UnitValue(doc_width,"px"), UnitValue(100 - offset,"%"), AnchorPosition.BOTTOMCENTER);
		// Restore canvas size
		app.activeDocument.resizeCanvas(UnitValue(doc_width,"px"), UnitValue(doc_height,"px"), AnchorPosition.TOPCENTER);
		
		
	}
	
	
}


function format(){
	
	// Determine format
	
	if (doc_height > doc_width) {
		if (doc_height/doc_width < 1.1) {
			var format = "square";
		}
		else if (doc_height/doc_width > 1.1 && doc_height/doc_width < 1.2) {
			var format = "67";
		}
		else if (doc_height/doc_width > 1.2 && doc_height/doc_width < 1.4) {
			var format = "645";
		}
		else if (doc_height/doc_width > 1.4) {
			var format = "35mm";
		}
	}
	else {
		if (doc_width/doc_height < 1.1) {
			var format = "square";
		}
		else if (doc_width/doc_height > 1.1 && doc_width/doc_height < 1.2) {
			var format = "67";
		}
		else if (doc_width/doc_height > 1.2 && doc_width/doc_height < 1.4) {
			var format = "645";
		}
		else if (doc_width/doc_height > 1.4) {
			var format = "35mm";
		}
	}

	return format;
}


